#創建index函式
def index(request):
    city = 'Taiwan'
    appid = '7ecc59d03c8f7f199adafacabb4319ee'
    url = 'http://api.openweathermap.org/data/2.5/weather'

    params = {'q': city, 'appid': appid, 'units': 'metric'}
    r = requests.get(url=url, params=params)
    res = r.json()

    description = res['weather'][0]['description']
    icon = res['weather'][0]['icon']
    temp = res['main']['temp']

    realtime_temperature = database.child('Data').child('temp').get().val()
    realtime_humidy = database.child('Data').child('percent').get().val()

    return render(request, 'weatherapp/index.html', {'description': description,
                                                     'icon': icon,
                                                     'temp': int(temp),
                                                     'city': city,
                                                     'realtime_temperature': realtime_temperature,
                                                     'realtime_humidy': realtime_humidy
                                                     })
"""
-函式概述-
透過設定參數獲取api的值，
我們所採用的api是openweathermap，
抓取其中的即時天氣數據，
再將抓取到的值傳回weatherapp中的index.html，
便可透過前端設定，顯示此函數所回傳的值。
"""


#創建weather函式
def weather(request):
    if 'city' in request.POST:
        city = request.POST['city']
    else:
        city = 'taiwan'

    appid = '7ecc59d03c8f7f199adafacabb4319ee'
    url = 'http://api.openweathermap.org/data/2.5/forecast'

    params = {'q': city, 'appid': appid, 'units': 'metric'}
    r = requests.get(url=url, params=params)
    res = r.json()

    temp = []
    humidity = []
    feels_like = []
    cnt = []

    for i in range(0, 40):
        resp = res["list"][i]['main']
        temp.append(int(resp['temp']))
        humidity.append(int(resp['humidity']))
        feels_like.append(int(resp['feels_like']))
        cnt.append(res['list'][i]['dt_txt'])

    mylist = zip(temp, humidity, feels_like, cnt)

    return render(request, 'weatherapp/weather.html', {'city': city, 'mylist': mylist, })
