#創建global_map函式(畫出世界地圖)
def global_map(request) -> map:
    data = [('China', 550), ('Canada', 432), ('Japan', 326), ('United Kingdom', 254), ('Germany', 200),
            ('Australia', 123), ('Netherlands', 10)]
    c = (

        Map()
            .add("世界地圖", data, maptype="world")
            .set_series_opts(label_opts=opts.LabelOpts(is_show=False))
            .set_global_opts(
            title_opts=opts.TitleOpts(title="世界地圖"),
            visualmap_opts=opts.VisualMapOpts(max_=600), )
            .render('weatherapp/templates/weatherapp/map.html')
    )

    return render(request, 'weatherapp/map.html', {})
"""
-函式概述-
運用pyecharts模組中的Map可成功畫出世界地圖，
一樣可以透過調整參數可調整其所呈現的狀態，
只是要記得把'maptype'改成world，
否則會畫出中國地圖(因為此模組為中國人開發的)。
此外，pyecharts會自動生成動態的html檔(因此圖表具有互動性)，
html檔內的資料會隨函式的變動隨時更改，
所以此處回傳的是要生成html檔的位置。
"""


# 創建jump函式(利用分頁切換圖表)
def jump(request):
    tab = Tab()
    tab.add(line_markpoint(), "預測與驗證損失")
    tab.add(line_markpoint1(), "實際與預測溫度")
    tab.render("weatherapp/templates/weatherapp/line.html")
    return render(request, 'weatherapp/line.html')
"""
-函式概述-
運用pyecharts模組中的Tab可實現透過分頁切換圖表，
先透過tab.add()增加多個圖表，
再將寫好的繪圖函式放入前方(此處因應分頁需求，放入方才所寫的兩個折線圖函式)，
圖表分頁的顯示名稱放入後方，
pyecharts便會自動生成動態的html檔(因此圖表具有互動性)，
html檔內的資料會隨函式的變動隨時更改，
所以此處回傳的是要生成html檔的位置。
"""


# 創建news函式
def news(request):
    apikey = 'b0142c54659345a8ade995208b4fda72'
    q = 'weather'
    url = 'https://newsapi.org/v2/everything'
    title = []
    description = []
    img = []
    Url = []

    params = {'q': q, 'apiKey': apikey}
    r = requests.get(url=url, params=params)
    res = r.json()

    articles = res['articles']

    for i in range(len(articles)):
        article = articles[i]
        title.append(article['title'])
        description.append(article['description'])
        img.append(article['urlToImage'])
        Url.append(article['url'])

    mylist = zip(title, description, img, Url)

    return render(request, 'weatherapp/news.html', context={"mylist": mylist})
